import React from 'react';
import Link from 'react-router-dom';

function Navbar() {
    return (
        <nav>  
            <li><Link to='/'>Sağlık Hizmetim</Link></li>
            <li><Link to='/contact'>İletişim</Link></li>
        </nav>  
    )
}

export default Navbar;
